import { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import Popover from '@mui/material/Popover';
import Typography from '@mui/material/Typography';


const Welcome = () => {

  const [data, setData] = useState([]);
  let navigate = useNavigate();

  const getData = async () => {
    await fetch('db.json', {
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      }
    })
      .then((res) => res.json())
      .then((res) => {
        console.log(res);
        setData(res);
      });
  };

  useEffect(() => {
    const getDataAsync = async () => {
      await getData();
    }
    getDataAsync();
  }, []);

  return (
    <>
      <Navbar />
      <div className="welcome-content">
        <div className="welcome-header">
          {
            data.parents !== undefined && data.parents.length > 0 &&
            <h1>Välkommen {data.parents[0].name}</h1>
          }
        </div>
        <div className="welcome-box">
          {
            data.parents !== undefined && data.parents.map((item, index) => {
              return (
                <div key={index}>
                  <p>Du har {item.children.length} barn registrerat.</p>
                  <p>Din registrerade adress är: <br /> {data.parents[0].adress} <br /> {data.parents[0].postnummer} {data.parents[0].ort}</p>
                  {
                    item.children.map((child, index) => {
                      return (
                        <p key={index}>{child.name} - {child.age}</p>
                      )
                    })
                  }
                  <Typography
                    aria-owns={open ? 'mouse-over-popover' : undefined}
                    aria-haspopup="true"
                    onMouseEnter={handlePopoverOpen}
                    onMouseLeave={handlePopoverClose}
                  >
                    Hover with a Popover.
                  </Typography>
                  <Popover
                    id="mouse-over-popover"
                    sx={{
                      pointerEvents: 'none',
                    }}
                    open={open}
                    anchorEl={anchorEl}
                    anchorOrigin={{
                      vertical: 'bottom',
                      horizontal: 'left',
                    }}
                    transformOrigin={{
                      vertical: 'top',
                      horizontal: 'left',
                    }}
                    onClose={handlePopoverClose}
                    disableRestoreFocus
                  >
                    <Typography sx={{ p: 1 }}>I use Popover.</Typography>
                  </Popover>
                </div>
              )
            })
          }
        </div>
      </div>
      <button className="forward-button" onClick={() => { navigate('/select') }}>Gå Vidare</button>
    </>
  );
}

export default Welcome;
